  }
  render(){
    return(
      <div id="PackageDetails">
        <SideTitle h2="Package details" h6="Shipment Weight"/>
        <img src="/img/Package/volumetric.png" />
        <ul>
          {this.props.data.map((items)=>{
            return(
          <li>
            <p>
              <span>Actual Weight: </span>
              is exactly what the product weighs including packaging.
            </p>
          </li>
        )})}
        </ul>
        <p>Your package shipment price depends on the your package weigth
        </p>
      </div>
    )
  }
}

export default PackageDetails
